(36, 1055, '634126397', 'ES VENEZOLANO, CASADO Y CON DOS HIJOS: REALIZA DOS CONSULTAS LA PRIMERA QUE METIO SU NACIONALIDAD A PRINCIPIOS DEL 2021 POR SU FIRMA DIGITAL Y LE LLEGA REQUERIMIENTO EN JUNIO Y APORTA SU PASAPORTE COMPLETO Y DICE QUE SI SE PUEDE AGILIZAR, SE LE INDICA QUE DEBE ESPERAR UN POCO MAS YA QUE EL PROCESO VA EN SU CURSO NORMAL SEGUNDO: QUE TIENE HIJO QUE NACIO AQUI Y TIENE REGISTRO DE NACIMIENTO ESPAÑOL MAS NO NACIONALIDAD Y AL NO TENER DOCUMENTOS METIO A SU HIJO EN LA SOLICITUD DE ASILO, AHORA TODOS TIENEN RAZONES HUMANITARIAS Y DEBE RENOVARLE Y NO LE RENOVAN POR QUE EL NINO NO ESTA NACIONALIZADO VENEZOLANO YA QUE AUN NO TIENE NI REGISTRO NI PASAPORTE SOLO LIBRO DE FGAMILIA, SE LE EXPLICA QUE TODO DOCUMENTO DE INMIGRANTE PARA SU IDENTIFICACION ES EL PASAPORTE PARA LO CUAL DEBIA NACIONALIZARLO DESDE QUE NACIO Y SE L EEXPLICA QUE MUCHAS VECES LA INFORMACION DE LOS FUNCIONARIOS NO ES LA MAS ACERTADA, LE ATIENDE CAROLINA', 'a', '2022-01-21', '2022-01-21 12:53:25', '2022-01-21 12:53:25'),
