(58, 1453, '632604328', 'NOS HA RECOMENDADO DON ALBERTO PARA DAR ESTA CONSULTA . LAURA TIENE SU ESPOSO Y EL DESPUES DE TENER HOJA BLANCA Y DOS RENOVACIONES DE TARJETA ROJA LE DENEGARON LA SOLICITU DE ASILO Y SOLICITO ARRAIGO SOCIAL, TIENE LA TARJETA DE UN AÑO Y DEBE COTIZAR PARA RENOVAR PERO SOLO LLEGO A COTIZAR 3 MESES CON EL JEFE QUE LE DIO LA OFERTA YA QUE ESTE CERRO SU LOCAL Y AHORA EL INTERESADO QUIERE DARSE DE ALTA COMO AUTONOMO Y CAMBIAR LA TARJETA A CUENTA PROPIA. SE LE EXPLICA QUE NO CABE ESA POSIBILIDAD Y QUE SOLO TENIENDOLA TARJET DE LARGA DURACION PUEDE SER AUTONOMO O AL RENOVAR SU TARJETA Y OPTAR A LA NACIONALIDAD ESPAÑOLA Y  DARSE DE ALTA COMO AUTONOMO. SU TARJETA SE VENCE EL 05.05.2022 Y SE LLAMA JUAN DAVID(CAROLINA)', 'a', '2022-03-04', '2022-03-04 11:21:44', '2022-03-04 11:24:09'),
